import React from 'react';
import { Preloader, Placeholder } from 'react-preloading-screen';

export default class Preload extends React.Component {
    render() {
        return (
            <Preloader>
                <Placeholder>
                    <div className="spinner-grow text-muted"/>
                </Placeholder>
            </Preloader>
        );
    }
}
